"use strict";

var _login = _interopRequireDefault(require("../pageobjects/login.page"));

var _secure = _interopRequireDefault(require("../pageobjects/secure.page"));

function _interopRequireDefault(obj) { return obj && obj.__esModule ? obj : { default: obj }; }

describe('My Login application', () => {
  it('should login with valid credentials', async () => {
    await _login.default.open();
    await _login.default.login('tomsmith', 'SuperSecretPassword!');
    await expect(_secure.default.flashAlert).toBeExisting();
    await expect(_secure.default.flashAlert).toHaveTextContaining('You logged into a secure area!');
